public Element getNext(IntrusiveCollection<? extends Element> list) {
  for (int i = 0; i < triplets.length; i += 3) {
    if (triplets[i] == list) {
      return (Element)triplets[i + 2];
    }
  }
  throw new RuntimeException("Called getNext on an element that wasn't " +
      "in the list.");
}
